import { useState } from "react"
import "./styles.css"

const Checkbox = ({state, setState}) => {
    return (
        <div>
            <label className="container">
                <input type="checkbox" checked={state} onClick={setState((prev: any)=> !prev)} />
                <span className="checkmark"></span>
            </label>
        </div>

    )
}

export default Checkbox
